import React, { Fragment } from "react";
import { Row, Col, Input, Modal, Typography } from "antd";

const { Text } = Typography;
const CustomModal = ({ visible, onSubmit, onCancel, data }) => {
  return (
    <Modal
      title="Edit info"
      visible={visible}
      onOk={onSubmit}
      onCancel={onCancel}
    >
      {data === null ? (
        console.log("error")
      ) : (
        <Fragment>
          <Input value={data.name} />
          <Select>
            <Select.Option></Select.Option>
          </Select>
        </Fragment>
      )}
    </Modal>
  );
};

export default CustomModal;
